  const options = {
    method: 'GET',
    url: baseUrl,
    params: {
      username: username,
    },
    headers: {
      'x-rapidapi-key': API_KEY,
      'x-rapidapi-host':
        'instagram-scrapper-posts-reels-stories-downloader.p.rapidapi.com',
    },
  };

